var inputNames = [
    "union-number", "lname", "fname", "mi", "occupation", "address", "phone",
    "city", "state", "zip", "employer", "employment-date", "employer-address",
    "employer-phone", "employer-city", "employer-state", "employer-zip", "fee",
    "paid-to", "dob", "ssn", "membership", "previous-union-number"
];

//ts/////////////////////////////////////////////////////////////////////////
var putToDB = [];
//////////////////////////////////////////////////////////////////////////

function init() {
    document.forms["application"]["membership"].onchange = function () {
        toggleUnionNumber()
    };
    document.forms["application"].onsubmit = function (e) {
        submission(e)
    };
}

function toggleUnionNumber() {
    document.forms["application"]["previous-union-number"].disabled ^= true;
    document.forms["application"]["previous-union-number"].required ^= true;
}

function submission(e) {
    if (e.preventDefault) {
        console.log("default prevented");
        e.preventDefault();
    }
    let data = {};
    for (let i = 0; i < inputNames.length; i++) {
        if (inputNames[i] === "membership") {
            if (!document.forms["application"][inputNames[i]].checked) {
                data[inputNames[i]] = "NO";
            } else {
                data[inputNames[i]] = document.forms["application"][inputNames[i]].value;
            }
        } else {
            data[inputNames[i]] = document.forms["application"][inputNames[i]].value;
        }
        //ts//////////////////////////////////////////////////////////////////////////
        putToDB.push(data[inputNames[i]]);
        console.log('putToDB = ' + putToDB);
        //////////////////////////////////////////////////////////////////////////////
    }
    submitToPDF(data);
    return false;
}

function submitToPDF(data) {
    let header = {
        "size": 12,
        "style": "bold"
    };
    let subheader = {
        "size": 10,
        "style": "bold"
    };
    let body = {
        "size": 8,
        "style": "normal"
    };
    let date = new Date();
    let subDate = `${date.getMonth() + 1}-${date.getDate()}-${date.getFullYear()}`;
    let name = `teamster-application-${subDate}-${date.getHours()}:${date.getMinutes()}:${date.getSeconds()}`;
    doc = new Document(40, header, subheader, body, name);

    /*getDataUri('img/logo.png', function(imgDataURI) {
        doc.image(imgDataURI, 100, 100);
        doc.toPDF();
    });*/
    doc.image(logo(), 100, 100);

    doc.print(`APPLICATION AND NOTICE For Membership in Local Union No. ${data["union-number"]}`, "header");
    doc.print(`Affiliated with the International Brotherhood of Teamsters`, "subheader");
    doc.newLine();

    let p1 = `I voluntarily submit this Application for Membership in Local Union
  ${data["union-number"]}, affiliated with the International Brotherhood of
  Teamsters, so that I may fully participate in the activities of the Union. I
  understand that by becoming and remaining a member of the Union, I will be
  entitled to attend membership meetings, participated in the development of
  contract proposals for collective bargaining, vote to ratify or reject collective
  bargaining agreements, run for Union office or support candidates of my choice,
  recieve Union publications and take advantage of programs available only to
  Union members. I understand that only as a member of the Union will I be able
  to determine the course the Union takes to represent me in negotiations to
  improve my wages, fringe benefits and working conditions. And, I understand
  that the Union's strength and ability to represent my interests depends on my
  exercising right, as guaranteed by federal law, to join the Union and engage
  in collective activities with my fellow workers.`;
    p1 = p1.replace(/\r?\n|\r/g, "");
    doc.print(p1, "body");
    doc.newLine();

    let p2 = `I understand that under current law, I may elect "nonmember" status,
   and can satisfy any contractual obligation necessary to retain my employment
   by paying an amount equal to the uniform dues and initiation fee required of
   members of the Union. I also understand that if I elect not to become a member
   or remain a member, I may object to paying the pro-rata portion of regular
   Union dues or fees that are not germane to collective bargaining, contract
   administration and grievance adjustment, and I can request the Local Union to
   provide me with information concerning its most recent allocation of
   expenditures devoted to activities that are both germane and non-germane to
   its performance as the collective bargaining representative sufficient to
   enable me to decide whether or not to become an objector. I understand that
   nonmembers who choose to object to paying the pro-rata portion of regular
   Union dues or fees that are not germane to collective bargaining will be
   entitled to a reduction in fees based on the aforementioned allocation of
   expenditures, and will have the right to challege the correctness of the
   allocation. The procedures for filing such challenges will be provided by my
   Local Union, upon request.`;
    p2 = p2.replace(/\r?\n|\r/g, "");
    doc.print(p2, "body");
    doc.newLine();

    let p3 = `I have read and understood the options available to me and submit
  this application to be admitted as a member of the Local Union.`
    p3 = p3.replace(/\r?\n|\r/g, "");
    doc.print(p3, "body");
    doc.newLine();

    doc.printFormLine(["NAME", "OCCUPATION"], [`${data.lname}, ${data.fname} ${data.mi}.`, data.occupation]);
    //doc.printLine(`PRINT: ${data.lname}, ${data.fname} ${data.mi} Occupation: ${data.occupation}`, "body");
    doc.printFormLine(["STREET", "PHONE"], [data.address, data.phone]);
    //doc.printLine(`Street: ${data.address} Phone: ${data.phone}`, "body");
    doc.printFormLine(["CITY", "STATE", "ZIP CODE"], [data.city, data.state, data.zip]);
    //doc.printLine(`City: ${data.address} State: ${data.state} Zip Code: ${data.zip}`, "body");
    doc.printFormLine(["EMPLOYER", "EMPLOYMENT DATE"], [data.employer, data["employment-date"]]);
    //doc.printLine(`Employer: ${data.employer} Employment Date: ${data["employment-date"]}`, "body");
    doc.printFormLine(["STREET", "PHONE"], [data["employer-address"], data["employer-phone"]]);
    //doc.printLine(`Street: ${data["employer-address"]} Phone: ${data["employer-phone"]}`, "body");
    doc.printFormLine(["CITY", "STATE", "ZIP CODE"], [data["employer-city"], data["employer-state"], data["employer-zip"]]);
    //doc.printLine(`City: ${data["employer-city"]} State: ${data["employer-state"]} Zip Code: ${data["employer-zip"]}`, "body");
    doc.printFormLine(["INITIATION FEE $", "PAID TO"], [data.fee, data["paid-to"]]);
    //doc.printLine(`Initiation Fee: $${data.fee} Paid to: ${data["paid-to"]}`, "body");
    doc.printFormLine(["DATE OF BIRTH", "SOCIAL SECURITY NO."], [data.dob, data.ssn]);
    //doc.printLine(`Date of Birth: ${data.dob} Social Security No.: ${data.ssn}`, "body");
    doc.printFormLine(["Have you ever been a member of a Teamster Local Union?"], [data.membership]);
    //doc.printLine(`Have you ever been a member of a Teamster Local Union? : ${data.membership}`, "body");
    doc.printFormLine(["If yes, what Local Union No."], [data["previous-union-number"]]);
    //doc.printLine(`If yes, what Local Union No.: ${data["previous-union-number"]}`, "body");
    doc.printFormLine(["DATE OF APPLICATION", "SIGNATURE OF APPLICANT"], [subDate, ""], true);
    //doc.printLine(`DATE OF APPLICATION: ${subDate}`, "body");
    //doc.newLine();
    //doc.horizontalRule();
    //doc.printLine(`SIGNATURE OF APPLICANT`, "body");
    //doc.printLine(p3, "body");
    //let container = document.getElementById("container");
    let pane = document.createElement("div");
    pane.style.width = "100%";
    pane.style.height = "100%";
    pane.style.position = "fixed";
    pane.style.top = "0";
    pane.style.backgroundColor = "rgba(0,0,0,0.5)";

    let view = document.createElement("object");
    view.data = doc.toBase64();
    view.type = "application/pdf";
    view.style.width = "90%";
    view.style.display = "block";
    view.style.margin = "auto";
    view.style.height = "720px";
    view.style.marginBottom = "1%";

    let button = document.createElement("button");
    button.innerHTML = "Go Back";
    button.style.padding = "1%";
    button.style.display = "block";
    button.style.margin = "auto";
    button.onclick = function (e) {
        let parent = e.toElement.parentNode;
        document.body.removeChild(parent);
    };

    pane.appendChild(view);
    pane.appendChild(button);
    document.body.appendChild(pane);

    //doc.toPDF();
}

function message(msg, color, textColor) {
    var div = document.createElement("div");
    div.innerHTML = msg;
    div.style.padding = "1%";
    div.style.zIndex = "1";
    div.style.width = "80%";
    div.style.marginLeft = "10%";
    div.style.position = "fixed";
    div.style.bottom = "0";
    div.style.textAlign = "center";
    div.style.borderRadius = "10px";
    div.style.transition = "0.5s";
    div.style.wordBreak = "break-all";
    div.id = "message";

    if (color !== undefined) {
        div.style.background = color;
    } else {
        div.style.background = "white";
    }
    if (textColor !== undefined) {
        div.style.color = textColor;
    } else {
        div.style.color = "black";
    }

    document.body.appendChild(div);

    setTimeout(function () {
        var close = document.getElementById("message");
        close.style.opacity = "0";
        setTimeout(function () {
            var close = document.getElementById("message");
            close.parentNode.removeChild(close);
        }, 1000);
    }, 7000);
}

